import React, { Component } from 'react'

class Plans extends Component {
    render() {
        return (
                <div className='row'>
                    <h3 className='orange-text'>Planos</h3>
                    <h6>Escolha o plano que mais combina com voce</h6>
                    <br></br>
                    {process.env.REACT_APP_PLANS.split(',').map(p => 
                    <div className='col s4'>
                        <div className='card-panel grey lighten-5'>
                            <h5>{p.split(' ')[0]} </h5>
                            <p>R$<h4 className='amber-text'>{p.split(' ')[1]}</h4>/mes</p>
                            <a class="waves-effect waves-light amber btn">comprar</a>
                        </div>
                    </div>
                    )}
                </div>
        )
    }
}

export default Plans
